import Tdata from "./Tdata"
import TableRow from "./TableRow"

const Column =(props)=>{
    return(
        <>
        <table style={{ width: 500 }}>
                <thead>
                    <tr>
                        {props.heading.map(head => <th>{head}</th>)}
                    </tr>
                </thead>
                <tbody>
                    {props.tBody.map(row => <TableRow row={row} />)}
                </tbody>
            </table>
        </>
    )
}
export default Column
